### YamlMime:QSharpType
uid: microsoft.quantum.arrays.sequencel
name: SequenceL
type: function
namespace: Microsoft.Quantum.Arrays
summary: Obter uma variedade de inteiros num determinado intervalo.
remarks: A diferença `from` `to` entre e `Int` deve caber num valor.
examples: >-
  ```qsharp

  let arr1 = SequenceL(0L, 3L); // [0L, 1L, 2L, 3L]

  let arr2 = SequenceL(23L, 29L); // [23L, 24L, 25L, 26L, 27L, 28L, 29L]

  let arr3 = SequenceL(-5L, -2L); // [-5L, -4L, -3L, -2L]

  ```
syntax: 'function SequenceL (from : BigInt, to : BigInt) : BigInt[]'
input:
  content: '(from : BigInt, to : BigInt)'
  types:
  - name: from
    summary: Um índice de início inclusivo do intervalo.
    isPrimitive: true
    uid: BigInt
  - name: to
    summary: Um índice final inclusivo do intervalo que `from`não é menor do que .
    isPrimitive: true
    uid: BigInt
output:
  content: BigInt[]
  types:
  - summary: Uma matriz que `from`contém `from + 1`a `to`sequência de números, ......, ....
    isArray: true
    isPrimitive: true
    uid: BigInt
